const UserTasks = ({users}) => {
    return (
        <>
        {
             users.map((curUser) => {
                const {day,description} = curUser;

                return (
                    <tr>
                        <td>{day}</td>
                        <td>{description}</td>
                    </tr>
                )
            })

        }
       
        </>
    )
}

export default UserTasks;
